INSERT INTO `dh_announcement` VALUES ('42', '呱呱好车', '呱呱好车', null, '<p>\r\n	<p>\r\n		<span style=\"color:#222222;font-family:Consolas, &quot;font-size:15px;background-color:#FFFFFF;\">仟万人民币，公司坐落于美丽富饶、交通便利、经济发达，素有川西明珠之称的四川省德阳市，公司在国家新政策的指导下，创建呱呱好车汽车商城，并开发运用互联网</span>\r\n	</p>\r\n	<p>\r\n		<span style=\"color:#222222;font-family:Consolas, &quot;font-size:15px;background-color:#FFFFFF;\">汽车销售、汽车美容、汽车租赁、汽车金融、二手车交易、汽车俱乐部于一体的大型综合服务平台，</span>\r\n	</p>\r\n</p>\r\n<br />', '1', '3', '1', '1508330456', '1517448378');
