INSERT INTO `dh_announcement` VALUES ('70', '注册须知', '辽宁慧百企业管理有限公司', null, '<p class=\"MsoNormal\" style=\"margin-left:0pt;text-indent:21pt;\">\r\n	<span>&nbsp; &nbsp; &nbsp; &nbsp; 尊敬的顾客，</span>当您申请用户时，表示您已经同意遵守本规章。<span>本商城依据下列条款及条件为您提供会员服务，此条款为本商城与本商城用户之间的服务协议，具有合同效力。请您务必在注册之前认真阅读全部协议内容，如有任何疑问，可向本商城客服人员进行咨询。</span>&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>一、协议说明&nbsp;</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1、协议双方为本商城与本商城用户；\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>、无论用户事实上是否在注册之前认真阅读了本协议，只要用户按照本商城网站注册程序成功注册为会员用户，您的行为表示您同意并签署了本协议；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	3<span>、本协议所称之“会员”，指依本站所定之会员加入程序顺利完成者；</span><span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4<span>、经本站认定为不适合加入会员者，本站保留有可拒绝其加入会员资格之权利；已加入会员者，本网站亦保留有解除其会员资格之权利；</span><span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	5<span>、本协议修订时，将会在本商城网站上进行告知；</span><span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	6<span>、本商城各项服务的所有权、运作权、条款解释权、未尽事宜解释权归本商城所有。</span><span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>二、用户资格&nbsp;</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1、用户必须是具备《中华人民共和国民法通则》规定的完全民事行为能力的自然人，或者是具有相应合法证照的实体组织。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>、无民事行为能力人、限制民事行为能力人以及无合法证照的组织不得注册并使用，如果以不当方式注册为本商城会员，则与本协议自始无效，本网站有权注销其会员资格。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>三、使用规则</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1、用户在申请使用本商城服务时，必须向本商城网站提供详尽、准确的个人资料。如个人资料有任何变动，必须及时更新；\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>、用户不应将其账号、密码转让或借予他人使用。如用户发现其账号遭他人非法使用，应立即通知本商城。由于黑客行为或用户原因导致账号、密码遭他人非法使用，一切责任及后果均由该用户自行承担；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	3<span>、用户通过本商城（包括但不限于论坛、商品评论）上传到本网站上可公开获取区域的任何内容，表明用户同意本网站在全世界范围内具有免费的、永久性的、不可撤销的完全再许可的权利；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4<span>、用户在使用本商城网站服务过程中，必须遵循以下原则：</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•遵守中国有关的法律和法规；\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•遵守所有与网络服务有关的网络协议、规定和程序；\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•不得利用本商城网站服务系统进行任何可能对互联网正常运转造成不利影响的行为；\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•不得利用本商城网站提供的网络服务上传、展示或传播任何虚假的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、庸俗淫秽的或其他任何非法的信息资料；\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•不得侵犯其他任何第三方的专利权、著作权、商标权、名誉权、肖像权或其他合法权益；\r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•不得利用本商城网站服务系统从事任何不利于本网站的行为活动；<span>&nbsp;</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">\r\n	•本商城网站有权对用户使用本网站服务的情况进行审查和监督，如用户在使用网络服务时违反任何上述规定，本商城或其授权人有权要求用户改正或直接采取一切必要的措施（包括但不限于更改或删除用户张贴的内容、暂停或终止用户使用网络服务的权利等）以减轻用户不当行为造成的影响。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>四、免责声明&nbsp;</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>1</span><span>、用户明确同意其使用本商城网络服务所存在的风险将完全由其自己承担；因其使用本商城网站网络服务而产生的一切后果也由其自己承担，本网站对用户不承担任何其他责任；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>、本商城不担保运营商的网络服务一定能满足用户的要求，也不担保运营商网络服务不会中断，对网络服务的及时性、安全性、准确性也都不作担保；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	3<span>、对于因不可抗力或本商城网站不能控制的原因造成的网络服务中断或其它缺陷，本商城不承担任何责任，但将尽力减少因此而给用户造成的损失和影响；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4<span>、本商城对于使用者在使用本网站服务所致之任何直接、间接、衍生之财产或非财产之损害，不负赔偿责任；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	5<span>、用户同意，对于本商城网站向会员用户提供的免费服务及其引发的任何损失，本网站无需承担任何责任。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>五、邮件和短信服务&nbsp;</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>1</span><span>、本商城保留通过邮件、短信、网页公告及常规的信件的形式</span><span>,</span><span>对注册用户、购物用户发送订单信息、促销活动、服务条款的修改、服务变更等告知服务的权利。如果本商城能够证明以电子形式的信息已经发送给您或者在网站上公布，将被视为您已收到所有协议、声明、公告等相关内容的信息；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>、用户对于本网站的通知应当通过本网站对外正式公布的通信地址、传真号码、电子邮件地址、客服热线等联系信息进行送达。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>六、服务协议的修改</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>&nbsp; &nbsp; &nbsp; 本商城有权在必要时修改服务协议，本网站服务条款一旦发生变动，将会在重要页面上提示修改内容。如果不同意所改动的内容，用户可以主动取消获得的本网站信息服务。如果用户继续享用本网站信息服务，则视为接受服务协议的变动。本网站保留随时修改服务协议条款的权利，不需对用户或第三方负责。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>七、版权声明&nbsp;</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span>&nbsp; &nbsp; &nbsp; 本商城网站上的所有内容，诸如文字、图片、标识、数据、商标都是本网站或其内容提供者的财产，受中国和国际版权法的保护。未经本网站书面授权或许可不得以任何目的对本网站或其任何部分进行复制、复印、仿造、出售、转售、访问或以其他方式加以利用。</span> \r\n</p>\r\n<b></b> \r\n<p class=\"MsoNormal\">\r\n	<strong>八、违约赔偿&nbsp;</strong> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1<span>、因本商城违反有关法律、法规或本服务协议项下的任何条款而给用户造成损失，本网站同意承担由此造成的损害赔偿责任；</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2<span>、如因用户违反有关法律、法规或本服务协议项下的任何条款而给本商城或任何其他第三人造成损失，用户同意承担由此造成的损害赔偿责任。</span> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span><strong>九、法律管辖和适用</strong></span><strong>&nbsp;</strong> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	1、本协议的订立、执行和解释及争议的解决均适用中华人民共和国法律；\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	2、本协议之任何一部分与中华人民共和国法律相抵触，则该部分条款将完全按法律规定重新解释；\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	3、本协议的规定是可分割的，如本协议任何规定被裁定为无效或不可执行，该规定可被删除而其余条款应予以执行；\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	4、如双方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向本商城所在地的人民法院提起诉讼。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b></b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp;\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '1', '5', '1', '1511771397', '1515657908');
