INSERT INTO `dh_announcement` VALUES ('73', '合伙人协议', '辽宁慧百企业管理有限公司', 'uploads/image/201710/21/20171021101843_56297.jpeg', '<p class=\"MsoNormal\">\r\n	<span>&nbsp; &nbsp; &nbsp; &nbsp;本协议由同意并承诺遵守本协议之规定使用辽宁惠百惠企业管理有限公司电子网络交易平台</span>(APP-JC健超)服务的,&nbsp;网上注册入驻本电子网络交易平台(APP-JC健超)的法律实体,以下简称“甲方”&nbsp;(用户或商户)；辽宁惠百惠企业管理有限公司网络交易平台服务,&nbsp;以下简称“乙方”(APP-JC健超)共同缔结&nbsp;。本协议以下简称甲方、乙方。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b>一、协议内容及生效:</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;(一)本协议内容包括协议正文及所有乙方已经发布的或未来可能发布的各类规则,为协议不可分割的一部分,具有同等法律效力。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;(二)&nbsp;甲方在使用乙方提供的各项服务的同时,承诺接受并遵守各项相关规则的规定。乙方有权根据需要制定、修改本协议或各类规则,如本协议有任何变更,&nbsp;乙方将在服务平台上以公告形式通知甲方。任何修订和新规则一经公布即自动生效,成为本协议的一部分。登录或继续使用服务将表示甲方接受经修订的协议。除另行明确声明外,任何使服务范围扩大或功能増强的新内容均受本协议约束。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;(三)甲方使用乙方网上平台(APP-JC健超)在线注册同意接受本协议并不导致本协议立即生效,经过乙方审核通过,以甲方在平台上注册成功,作为发出服务开通通知时,&nbsp;本协议即在甲方和乙方之间产生法律效力。<br />\r\n<b><span>二、定义</span>:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>协议</span>:指由乙方提供网络技术支持和服务的电子商务网络交易平台(APP-JC健超)。该平台是提供给甲方(用户或商户)注册发布或查寻商品信息,进行商品交流、交易、意向达成及提供其他与交易各方有关的辅助服务和信息服务的空间。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>甲方</span>(用户或商户)及其注册:身份证明及资质必须符合中国相关法律文件之规定,如:无营业执照、无经营资格、无身份证等或违反本协议第五条之声明与保证的组织不当注册为乙方网上商户或超越其民事权利或行为能力范围从事交易的,&nbsp;其与本协议之间的协议自始无效,一经发现,乙方有权立即注销该甲方在乙方网上的服务账户,&nbsp;保留并有权追究其使用本协议服务过程所产生的一切法律责任。注册是指甲方登陆乙方电子商务网络交易平台(APP-JC健超),按注册要求如实填写相关注信息,以最终激活其服务账户的过程,&nbsp;且在线闻读并确认接受本协议,&nbsp;即视为协议生效。网上服务账户:即甲方(用户或商户)完成注册流程而获得的其将在使用服务的过程中必须与自设的账户密码共同使用的甲方(用户名或者商家)名称及其帐<span>号</span><span>,&nbsp;统称网上服务用户名。甲方应妥善保管其服务账户及密码的信息,不得以任何形式擅自转让或授权他人使用自己的网上服务账户;“服务”:&nbsp;是指由乙方在其网上交易平台向甲方提供的互联网信息发布、商业推广、商品交易的过程及结果等与此有关的互联网技术服务。</span> \r\n</p>\r\n<p class=\"MsoNormal\" style=\"margin-left:0pt;text-indent:0pt;\">\r\n	<span>具体服务内容如下</span>:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; <span>网络信息服务</span>:&nbsp;是指甲方根据本协议的规定利用乙方网上交易平台登记、査询商品及发布商品信息、作为卖方与其它用户订立商品买卖合同、商品交易完成及评价其它用户的信用、参加乙方网络交易平台有关活动以及其他其同意提供的信息服务;&nbsp;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>积分推广服务</span>:指由乙方向甲方提供的通过其网上交易平台实施的商业推广服务,具体规定见本协议第十二条。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; <span>店铺专用</span>BBS服务:指向甲方提供的专用BBS空间,&nbsp;供甲方发布与自销商品有关的信息,并收集其他用户对其商品及服务的反馈。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; <span>其他服务</span>:乙方保留在任何时候自行决定对服务及其相关功能、应用软件变更、升级的权利;并进一步保留在服务中开发新的模块、功能和软件或其它语种服务的权利。上述所有新的模块、功能、软件服务的提供,除非乙方另有说明,否则仍适用本协议。服务随时可能因乙方的単方判断而被增加或修改,或因定期、不定期的维护而暂缓提供,&nbsp;甲方将会得到乙方相应的网上公告变更通知。甲方在此同意乙方在任何情况下都无需向其或第三方在使用服务时对其在传输或联络中的迟延、不准确、错误或疏漏及因此而致使的损害负责。<br />\r\n<span>乙方服务条款</span>:由协议方另行签署的确认与本协议服务有关的各项个性化规定的契约文件,服务条款内容与本协议内容存在冲突,以本协议服务条款内容为准。<br />\r\n<b><span>三、证明文件提交</span>:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;1、证明文件提交:甲方在使用本协议服务时,必须根据本协议的要求向乙方或者规定合作方提交其在申请服务时应当提供的证明文件或其他相关证明及其相关信息。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;2、证明文件变更的通知:协议期内,上述相关证明文件及信息的任何变更,甲方都应及时通知乙方,如上述证明文件变更后导致甲方不再符合或具备不再履行本协议的情形出现时,乙方有权立即中止或终止本协议。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;3、乙方有权对甲方的证明文件及相关资质进行线上或者线下不定时抽察审验,并有权要求其提供更多详细的证明文件及相关资质,甲方需按要求及时如实提供。如不能及时如实提供,&nbsp;则乙方有权立即终止或中止本协议。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;4、责任条款:甲方同意因其变更或未如实的向乙方平台提供或更新其完整的证明文件、资质、身份证明等信息或其它相关信息的应承担全部责任;甲方保证其向乙方平台提供的全部证明文件资质真实、准确且不存在超过时效问题(即保证所有证明文件在整个合同履行期间都处于有效期内)如因上述原因发生纠纷或被相关国家主管机关处罚,甲方应当独立承担全部责任,如给乙方(包括其合作伙伴、代理人、职员等)造成损失的,&nbsp;甲方应赔偿其全部损失。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span>四、</span>&nbsp;申请条件:</b><br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span>申请使用本协议服务的甲方必须同时满足以下条件</span>:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;1、符合甲方在乙方网上平台注册时,甲方保证应如实、真实提供注册时所填写的具体资质、信息内容与其实际情况相一致的要求;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;2、提交了本协议第三条约定的相关证明文件并获得乙方认可;<br />\r\n<b>五、甲方的声明与保证</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;1、符合乙方规定的申请条件,提供真实、合法、准确、有效的注册资质及相关资料信息,并保证其诸如:开户银行信息完整真实、电子邮件地址、联系电话、用户或商户地址等内容的有效性及安全性,并保证其真实合法性;&nbsp;便于乙方及其他用户可以通过上述联系方式与其沟通、联系。同时,也有义务在相关资料实际变更时及时完整更新有关注册资料。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;2、其承诺遵守本协议以及所有公示于乙方网上平台上的规则和流程。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;3、其有合法的权利缔结本协议,使用乙方网上平台相关服务。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;4、其发布于乙方网上平台的所有信息真实、准确,符合相关法律法规及乙方网上平台规则。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;5、其对其发布于乙方网上平台的交易信息中所涉商品有合法的销售权。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;6、其将按照不低于《中华人民共和国产品质量法》、《中华人民共和国消费者权益保护法》及其他法规、部门规章和国家强制性标准规定的要求,出售商品并提供“三包”等售后服务&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;7、其在乙方网上平台出售商品,有义务按照买家实际支付的现金金额为买家开具合格发票,相关税收应按国家相关规定由商户自行承担申报缴纳。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;8、其保证在使用乙方网上平台服务进行交易的过程中,遵守诚实信用的原则,不在交易过程中采取不正当竞争行为,不扰乱网上交易的正常秩序,不从事与网上交易无关的行为。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;9、其保证在使用乙方网上平台服务时,&nbsp;实施的所有行为均遵守国家法律、法规和乙方的相关规则、规定以及各种社会公共利益及公共道德。如有违反导致任何法律后果的发生,其将以自己的名义独立承担所有相应的法律责任;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; 10、其同意不对乙方网上平台服务上的任何数据作商业性利用,包括但不限于在未经乙方事先书面批准的情况下,以复制、传播或向他方披露等方式使用在乙方网上其他用户展示的任何资料；<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;11、其承诺对其店铺专用BBS负有管理义务,&nbsp;对其店铺专用BBS出现的违反国家有关法律、法规规定及乙方网上服务规则的信息予以立即删除。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;12、其承诺拥有合法的权利和资格向乙方网上服务平台上传有关商品销售信息真实并进行真实销售或者交易,&nbsp;且前述行为未对任何第三方合法权益,&nbsp;包括但不限于第三方知识产权、物权等构成侵害,如因其行为导致乙方遭受任何第三方提起的索赔,&nbsp;诉讼或行政责任,&nbsp;其将承担相应责任并使乙方免责。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;13、其任何在线接受本协议的行为并不当然导致本协议发生法律效力,本协议是附条件生效协议,即必须经过乙方对其提交的全部资料审核、注册通过且满足本协议约定的生效条件后方可生效。同时,其认可乙方网上服务平台有权独立的对其注册资料真实、品牌经营权限开通申请进行评估、判断。审核结果以乙方评估、判断为准,其对此不持有任何异议。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;14、其承诺不在发布的商品中使用任何未获授权品牌的关键字。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;15、其承诺接受乙方对其出售商品是否具有合法进货来源的不定期检査,其有义务保留其商品具有合法进货来源的相关凭证。对于无法提供合法进货来源凭证的,乙方将根据实际情况对商品的真伪做出判断并根据本协议以及相关规则进行处理,&nbsp;甲方对此承担举证不利的后果&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;16、其承诺接受乙方基于商品品质控制需求对其在售商品进行的质量抽检,检测报告由专业的第三方质检机构出具,其承诺对其选择的第三方质检机构作出的检测结果不持有异议。对于经检测证明存在质量瑕疵的商品,检测费用由甲方承担。<br />\r\n<b>六、消费者保障</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;<span>（一）消费者保障</span>,只指甲方根据本协议约定的条款和条件及乙方网站上其他公示规则的规定,通过乙方网上平台发布除二手、闲置外的商品(以下简称“全新商品”)信息并利用支付中介服务向买家出售全新商品时,应履行“商品如实描述\"、“商品7天无理由退换货”、“正品保障”义务。乙方将在其网络平台上不时公示新増的消费者保障义务或对原消费者保障义务内容进行修订。如对新增或修订的消费者保障义务持有异议,应当终止本协议,如继续使用乙方服务,则意味着接受乙方的新增或修订内容。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;(1)、消费者保障内容：<br />\r\n<span>在甲方通过乙方网上平台发布商品信息以及与买家进行商品交易过程中</span>,&nbsp;其承诺遵守以下约定:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1、“如实描述”义务,指对上传于乙方网上平台的商品信息进行如实描述,并对描述的商品信息负有举证责任。有效的“如实描述”应涵盖以下内容:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2、甲方在发布商品时选择及填写的所有与商品本身有关的信息,包括但不限于文字描述、商品图片,买家均可在该商品的详情页面上进行直接査看;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3、甲方与买家在交易过程中利用乙方进行沟通时,商户就商品本身信息、邮费、发货情况、交易附帯物件向买家描述的内容也属于“商品描述信息”范围。商品功效信息及商品货源渠道信息描述则不属于“商品描述信息”范围;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4、商户有义务对商品本身存在的质量问题及瑕疵承担责任,&nbsp;除非商户已事先进行了质量问题及瑕疵的描述;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;5、如甲方在乙方平台精品类目下发布商品，应当使用实物拍摄图片，即甲方针对该件商品本身实际拍摄的图片，不包括杂志图片、官方网站图片及宣传图片。如甲方违反本条款之约定，则视为其违反了商品如实描述义务；<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>（</span>2）、“7天无理由退换货”义务:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1、甲方同意依据乙方在网上平台公示的积分规则内容提供退换货服务&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;2、甲方同意一旦买家在收到货物后提出以“7天无理由退换货”为退货原因的退款申请,&nbsp;或在交易成功后14天内提出“7天无理由退换货”赔付申请,&nbsp;甲方应积极配合,并根据乙方网上平台的要求在指定期间内提供真实、合法、有效的证据材料。根据商品类目不同,甲方应根据乙方网上通知的要求提交不同的证据材料,且乙方有权根据维权处理情况要求其进一步提供其它证明材料;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;3、甲方同意乙方网上平台在处理买家的“7天无理由换货\"赔付申请或相关退货申请时,有权以普通或非专业人员的知识水平标准对甲方和买家提交的证据材料进行表面审核,并依据该材料做出判断。如因甲方和买家提交的证据材料导致乙方判断错误造成损害,乙方不承担任何责任,甲方同意自行向受益人索赔;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;4、&nbsp;如甲方未能在指定期间内提供相关证据材料,或相关证据材料明显无效,&nbsp;乙方判定买家赔付申请成立,甲方同意按照本协议之约定向买家赔偿其受到的损失,&nbsp;赔偿金额为买家已实际支付的商品价款。此等情形下,乙方有权扣除相应金额款项先行赔付给买家。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>（</span>3）、“遵守承诺”义务:指甲方应当严格遵守通过各种方式直接或间接向买家做出的承诺,包括但不限于通过本协议、乙方相关规则及服务协议以及网络店铺、商品详情页面等方式向买家做出的承诺。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; <span>（</span>4）、“正品保障”义务:指当买家购买甲方在乙方网上服务平台出售的商品,在收到货物后,如买家认为该商品为假冒&nbsp;(包括盗版)商品货或非原厂正品、未经报关进口商品、假冒材质成份商品(其中假冒商品、未经报关进口商品、假冒材质成份商品的定义以乙方规则规定为准)且买家与商户协商未果的前提下,买家在乙方指定期间内发起针对甲方的维权,&nbsp;申请消费者保障赔付时,如乙方判定买家赔付申请成立,甲方同意按照本协议之约定向买家退回其实际支付的商品价款,并增加赔偿其受到的损失,增加赔偿的金额为买家实际支付商品价格的四倍，并承担维权所涉商品所有物流费用。部分特殊类目商品(如食品)的赔付办法,如国家相关法律法规规定的赔付标准高于本协议的,甲方同意以法律法规规定为准&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (二)消费者保障责任及处理<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 1&nbsp;.&nbsp;先行赔付:指甲方与乙方网络平台交易中的买家(以下简称“买家”)通过支付进行交易后,如因甲方未履行消费者保障承诺义务而导致买家权益受损的情况下,乙方有权以普通或非专业人员的知识水平标准,根据相关证据材料和规则受理或判定甲方是否应根据本协议的规定、本协议相关规则的规定履行赔付义务。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 2.甲方明确了解并同意其是消费者保障的责任主体。当发生本协议前述甲方应当履行消费者保障义务情形时,应保证买家的消费者权益。对于买家因前述问题提出的要求,甲方应积极处理&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 3.甲方同意当乙方受理买家提出的消费者保障维权和赔付申请时,其应积极配合,在乙方要求的时间期限内提供相&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 证据材料,以证明与买家交易的商品不存在买家提出的问题或符合双方的约定,&nbsp;并保&nbsp;&nbsp;&nbsp;调处完全是基于买家的委托,无法保证交易纠纷处理结果符合甲方的期望,也不对交易纠纷调处结果承担任何责任。甲方应保证其提交的证据材料的真实性、合法性,并承担其或买家提供的信息、数据不实的风险和责任。如买家因此遣受损失,同意自行向受益人索赔。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<b><span>七、</span>&nbsp;乙方的权利和义务:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(1)乙方有义务在现有技术上维护整个乙方网上交易平台的正常运行,并努力提升和改进技术,使甲方网上交易活动得以顺利进行;有权根据商户营业执照的经营范围以及甲方对自己店铺经营范围的描述自行决定(调整)允许甲方发布商品的商品类目种类和数量,甲方对此不持任何异议。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (2)对甲方在注册使用乙方网上平台服务中所遇到的与交易或注册有关的问题及反映的情况,乙方应及时做出回复;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (3)因网上交易平台的特殊性,乙方没有义务对所有甲方的交易行为以及与交易有关的其它事项进行事先审查，但如存在下列情况：<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;①第三方通知乙方,认为某个具体甲方或具体交易事项可能存在重大问题;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;②甲方或第三方向乙方告知交易平台上有违法或不当行为的;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;③乙方自己发现某个具体商户或具体交易事项可能存在重大问题。其以普通非专业人员的知识水平标准对相关内容进行判别,可以认为这些内容或行为具有违法或不当性质的,并有权根据不同情况选择删除相关信息、对商户店铺采取限制性措施或停止对该商户提供服务,&nbsp;涉及违反国家强制性法律的、侵犯他人合法权利的、违反合同约定的追究相关法律责任。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (4)乙方有权对甲方的注册数据及交易行为进行察闻,发现注册数据或交易行为中存在任何问题或怀疑,均有权向甲方发出询问或要求改正的通知,或者直接做出删除或对甲方采取限制性措施等处理;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (5)&nbsp;经国家生效法律文书或行政处罚决定确认甲方存在违法行为,或者乙方有足够事实依据可以认定甲方(商户)存在违法和 /或违反协议行为的,其有权在其网站公布甲方的违法或违规行为;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (6)&nbsp;对于甲方在乙方网上交易平台发布的下列各类信息,乙方有权在不通知甲方的前提下进行删除或采取其它限制性措施,包括但不限于以规避费用为目的的信息;以炒作信用、销量为目的的信息;乙方有理由相信存在欺诈等恶意或虚假内容的信息;乙方有理由相信与网上交易无关或不是以交易为目的的信息;&nbsp;乙方有理由相信存在恶意竞价或其它试图扰乱正常交易秩序因素的信息;乙方有理由相信属违反公共利益和/或可能严重损害乙方或其它用户合法利益的信息;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (7)&nbsp;甲方在此授予乙方免费的许可使用权利(并有权对该权利进行再授权)&nbsp;,&nbsp;使乙方有权(全部或部份地)使用、复制、修订、改写、发布、翻译、分发、执行和展示甲方公示于其在乙方网络店铺的各类信息或制作其派生作品,和/或以现在已知或日后开发的任何形式、媒体或技术,将上述信息纳入其它作品内;\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;(8)乙方有权根据业务调整情况将本协议项下的全部权利义务一并转移给其关联公司,此种情况将会提前30天以网站公告的形式通知甲方。甲方承诺对此不持有异议。<br />\r\n<b><span>八、服务的开通</span>:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (1)服务将在以下条件均满足后7个工作日内开通:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 1&nbsp;.甲方注册在线点击同意接受本协议;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 2.甲方在线填写注册信息,注册并最终与乙方通过在线点击同意的方式签订本协议;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 3.符合乙方规定的条件并提供相应的真实证明文件及相关资质;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 4.乙方审核通过甲方注册成功即为发出服务开通通知,即为甲方服务实际开通日&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (2)服务期限:&nbsp;自甲方注册服务实际开通日起算。或乙方另行将按本协议规定的通知方式通知甲方服务开通日&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (3)如甲方在线签署接受本协议后7个工作日内仍未满足本条第一款规定的所有开通条件,或乙方因任何原因在网上向甲方发出拒绝提供服务的网上公告,则乙方有权不予开通服务,本协议不生效。<br />\r\n<b>九、协议的终止</b><b><br />\r\n</b>&nbsp; &nbsp; &nbsp; &nbsp; (1)自然终止:本协议到期终止或甲方因任何原因协议终止,则本协议将同时终止。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (2)通知解除:协议任何一方均可以提前十五(15)天网上在线通知的方式终止本协议。则系统会立即使其店铺进入“监管\"状态,十五天(15)后店铺正式进入退出流程,甲方在退出流程后三十天(30)天内可以且尽可以处理交易纠纷以及与乙方之间的账务、发票结算事宜。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (3)乙方单方解除权:&nbsp;如甲方违反乙方的任何规则或本协议中的任何承诺或保证,包括但不限于本协议项下的任何约定,乙方都有权立刻终止本协议,且按有关规则对甲方进行处罚。如甲方销售假冒他人商标(版权)的商品、外贸商品(包括但不限于:外单、原单、尾单、剪标等各类商品),二手商品,或第三方多次投诉其商品质量或服务质量,则乙方除有权立即终止或中止本协议外,并处对甲方终止一切交易服务。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (4)甲方在超过九十(90)天的时间内未以乙方服务账户及密码登录乙方的,乙方有权终止本协议。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp; (5)如非因乙方的原因,甲方未能按本协议及附件之规定,按期全额支付有关服务费用和/或活动费用,且在乙方规定的时限内仍未支付,&nbsp;乙方有权部分或全部中止或终止本协议。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (6)&nbsp;本协议规定的其他协议终止条件发生或实现,导致本协议终止。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (7)协议终止后有关事项的处理:<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 1.协议终止后,乙方没有义务为甲方保留其服务账户中或与之相关的任何信息及资料,或转发任何未曾阅读或发送的信息给甲方或第三方。亦不就终止协议而对甲方或任何第三者承担任何责任;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 2.无论本协议因何原因终止,在协议终止前的行为所导致的任何赔偿和责任,甲方必须完全且独立地承担;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 3.协议终止后,乙方有权保留该甲方的注册数据及以前的交易行为记录。如甲方在协议终止前在乙方网络交易平台上存在违法行为或违反协议的行为,乙方仍可行使本协议所规定的权利;<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 4.协议终止之前,&nbsp;1)甲方已经上传至乙方网站的商品信息尚未达成交易协议的,乙方有权在协议终止时同时删除此项商品的相关信息;&nbsp;2&nbsp;)&nbsp;甲方已经与另一用户就某商品信息达成交易协议的,&nbsp;乙方可以不删除该项交易,但其有权在协议终止的同时将协议终止的的情况通知该交易中的买方。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 5.因为上述各项原因导致乙方终止本服务协议,甲方店铺在乙方作出终止本服务协议时立即进入退出流程,甲方在进入退出流程三十天(30)内可以且尽可以处理交易纠纷以及与乙方之间的账务、发票结算事宜&nbsp;。<br />\r\n<b><span>十、有效通知</span>:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; 本协议下所规定的通知,应在乙方网上平台以公告的形式向甲方发出,发出通知的送达以公告发布实际时间为基准。<br />\r\n<b><span>十一、保密条款</span>:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (1)&nbsp;本协议所称商业秘密包括但不限于本协议、任何补充协议所述内容及在合作过程中涉及的其他秘密信息。任何一方未经商业秘密提供方同意,均不得将该信息向任何第三方披露、传播、编辑或展示。协议方承诺,本协议终止后仍承担此条款下的保密义务,&nbsp;保密期将另行持续三年。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; (2)因对方书面同意以及国家行政、司法强制行为而披露商业秘密的,披露方不承担责任;该商业秘密已为公众所知悉的,披露方不承担责任。<br />\r\n<b><span>十二、</span>&nbsp;反不正当谋利</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>甲方不得通过不正当手段</span>(包括但不限于向乙方工作人员及/或其关联人士提供财物、消费、款待或商业机会等)谋取利益。如有违反,无论商家是否实际获得利益,乙方均有权根据其规则立即终止向甲方名下部分或所有甲方店铺提供服务&nbsp;。\r\n</p>\r\n<p>\r\n	<b>十三、乙方的法律地位</b> \r\n</p>\r\n<p class=\"MsoNormal\">\r\n	&nbsp; &nbsp; &nbsp; &nbsp;<span>乙方仅作为甲方用户物色交易对象</span>,就货物和服务的交易进行协商,以及获取各类与贸易相关的服务的平台。本协议的签署并不意味着乙方成为甲方在乙方网上平台与第三方所进行交易的参与者,对前述交易乙方仅提供技术服务,不对甲方行为的合法性、有效性及商品的真实性、合法性作任何明示或暗示的担保。甲方因进行交易、获取有偿服务或接触乙方服务器而发生的所有应纳税赋,均由甲方自行负责申报缴纳。<br />\r\n<b><span>十四、有限责任</span>:</b><b><br />\r\n</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(1)&nbsp;服务将按\"现状”和按\"可得到”的状态提供&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<span>乙方在此明确声明对服务不作任何明示或暗示的保证</span>,包括但不限于对服务的可适用性,没有错误或疏漏,持续性,准确性,可靠性,适用于某一特定用途之类的保证,声明或承诺。乙方对服务所涉的技术和信息的有效性,准确性,正确性,可靠性,质量,稳定,完整和及时性均不作承诺和保证。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2)使用服务下载或者获取任何资料的行为均出于甲方的独立判断和自由,并自行承担风险。甲方独自承担因此对其电脑系统或资料灭失造成的损失。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(3)不论在何种情况下,乙方均不对由于Enternet连接故障,电脑,通讯或其他系统的故障,电力故障,罢工,劳动争议,暴乱,起义,&nbsp;骚乱,生产力或生产资料不足,火灾,洪水,风暴,&nbsp;爆炸,不可抗力,战争,政府行为,国际、国内法院的命令或第三方的不作为而造成的不能服务或延迟服务承担责任。<br />\r\n<b><span>十五、违约责任</span>:</b><br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(1)&nbsp;甲方同意赔偿由于使用服务(包括但不限于将甲方资料展示在网站上)或违反本协议而给乙方造成的任何损失(包括但不限于由此产生的全额的诉讼费用和律师费)。甲方同意乙方对任何甲方张贴的资料,包括诽谤性的、攻击性的或非法的资料承担任何责任；由于此类材料对其它用户造成的损失由甲方自行承担全部责任。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2)甲方承诺,不会采取任何手段或措施,包括但不限于明示或暗示用户或通过其他方式转移其可以通过乙方网络交易平台在线或线下达成的交易,或达成交易后不经由乙方网上服务平台确认交易金额,以规避向乙方支付相关服务费用。否则将视为严重违约,乙方将有权立即终止本协议,就违约行为向甲方追偿&nbsp;。\r\n</p>\r\n<span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(3)</span><span>除本协议及乙方规则另行约定外，如一方发生违约行为,守约方应以在线通知方式发布公告要求违约方在指定的时限内停止违约行为,并就违约行为造成的损失进行索赔,如违约方未能按时停止违约行为,则守约方有权立即终止本协议。</span> \r\n<p class=\"MsoNormal\" style=\"margin-left:0pt;text-indent:0pt;\">\r\n	<b><span>十六、争议解决及其他</span>:</b><b><br />\r\n</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(1)本协议之解释与适用,以及与本协议有关的争议,均应依照中华人民共和国法律予以处理&nbsp;。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(2)如本协议的任何条款被视作无效或无法执行,则上述条款可被分离,其余部份则仍具有法律效力。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;(3)&nbsp;乙方于甲方过失或违约时放弃本协议规定的权利的,不得视为其对甲方的其他或以后同类之过失或违约行为弃权。<br />\r\n<b><span>十七、协议生效</span>:</b><b><br />\r\n</b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<span>本协议自甲方在乙方平台注册点击</span>“同意”按钮后,&nbsp;即视为同意并严格遵守本协议,协议随即生效,将对甲、乙双方产生法律约束力&nbsp;。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<br />\r\n</p>', '9', '6', '1', '1511771397', '1515655688');
