INSERT INTO `dh_announcement` VALUES ('79', '爱心公益服务协议', '辽宁惠百惠企业管理有限公司', null, '第一条总则<br />\r\n<p>\r\n	&nbsp; 本服务协议（以下简称“本协议”）是辽宁惠百惠企业管理有限公司（以下简称“惠百惠”）与惠百惠用户（以下简称“户”或“您”）就惠百惠爱心捐赠服务（以下简称”爱心捐赠”）的使用等相关事项所订立的有效合约。用户通过网络页面点击确认或以其他方式选择接受本协议，即表示用户与惠百惠已达成协议并同意接受本协议的全部约定内容。在接受本协议之前，请您仔细阅读本协议的全部内容。如果您不同意本协议的任意内容，或者无法准确理解惠百惠对条款的解释，请不要进行后续操作。惠百惠爱心捐赠服务，是指用户在惠百惠公益平台上选择需要捐赠的公益项目，设置捐赠金额等信息，在用户确认付款后，用户捐赠款项会立即到达用户选择的公益项目指定的收款惠百惠账户中。（以下简称“本服务”）。\r\n</p>\r\n<p>\r\n	第二条用户的权利义务\r\n</p>\r\n（一）您确认在使用本服务的意思表示出自您的真实意愿；同时您对使用本服务过程中发出的指令的真实性及有效性承担全部责任，该指令视为您的真实意思表示且不可变更或撤销。您承诺，惠百惠依照您的指令进行操作的一切风险均由您承担。<br />\r\n（二）您同意承诺不会利用本服务从事任何非法的或违反本协议目的或者侵犯其他第三方权益的行为，否则惠百惠有权立即单方面终止提供本服务，并不承担任何责任；如果因您的行为给惠百惠造成损失的，您应承担全部赔偿责任。<br />\r\n（三）您理解并同意，一旦您使用本服务捐赠了您设置金额的款项后，惠百惠会根据您的指令将款项即时支付到您选择的公益项目指定的收款惠百惠账户中。您理解并同意，该指令不可撤销。<br />\r\n（四）您理解并同意，对于您使用本服务捐赠的款项的具体用途等，均由您向您选择的公益项目所属的公益机构咨询了解，与惠百惠无关。<br />\r\n（五）您授权惠百惠在您使用本服务期间或惠百惠终止提供本服务后，有权保留您在使用本服务期间所形成的相关信息数据，同时该授权不可撤销。<br />\r\n（六）您在使用本服务期间，可以使用惠百惠支持的任一资金渠道，包括惠百惠账户余额、与已经开通快捷支付的借记卡，或其他惠百惠实际支持的扣款渠道。<br />\r\n（七）您理解并同意，当您选择爱心捐赠的公益项目已经达到所要募集的资金总额的，惠百惠会及时通知您该公益项目已经结束的信息，您的爱心捐赠可能无法成功。<br />\r\n（八）您通过本服务参与公益捐赠的，所发生的一切纠纷及损失与惠百惠无关，惠百惠不参与您与您选择捐赠的公益项目所对应的公益机构之间的纠纷。<br />\r\n（九）依据相关公益捐赠监管要求及为了保证公益捐赠的公开透明，您同意您的捐赠记录可被惠百惠和其他相关部门或机构通过公告、公示或其他途径展示在惠百惠客户端或其他平台，或用于公益项目的审计、公示。<br />\r\n（十）您在使用惠百惠提供的本项服务时，必须同时遵守惠百惠网站不时公布的《惠百惠服务协议》及相关附属规则，具体以惠百惠不时在页面提示的使用规则及限制为准，否则因此导致责任，均由您自行承担。<br />\r\n（十一）您对惠百惠爱心捐赠服务如有疑问、建议或意见时，可登录 JC APP进行咨询和投诉。<br />\r\n第三条惠百惠的权利、义务<br />\r\n（一）惠百惠对您的注册信息负有保密义务，但在必要时惠百惠有权将相关信息提供给惠百惠的监管机关及合作银行等。<br />\r\n（二）惠百惠有义务在技术上确保扣款服务的安全、有效、正常运行，保证您的正常使用。<br />\r\n（三）惠百惠可以在法律法规许可或您授权的范围内使用您在惠百惠留存的资料或交易信息等。<br />\r\n（四）您的资金若最终交易失败或发生退款的，您支付的资金会退回至您的惠百惠账户。<br />\r\n（五）除本协议另有规定外，惠百惠在提前留言通知您或在网站公告的情况下，可以单方面终止向您提供本服务，并不承担任何赔偿责任。惠百惠在终止提供本服务后，若发现您之前存在违法或违反本协议目的的使用行为，给惠百惠造成损失的，则惠百惠仍可据此要求您承担相应赔偿责任并保留通过司法途径予以解决的权利。<br />\r\n（六）您通过本服务参与公益捐赠的，所发生的一切纠纷及损失与惠百惠无关，惠百惠不参与您与您选择捐赠的公益项目所对应的公益机构之间的纠纷。<br />\r\n（七）您理解并同意，使用本服务必须遵守国家有关法律和政策等，维护国家利益，保护国家安全，并遵守本条款，对于您违法或违反本条款的使用（包括但不限于言论发表、传送等）而引起的一切责任，由您负全部责任，与惠百惠无关。<br />\r\n（八）您在使用惠百惠提供的本项服务时，必须同时遵守JC APP不时公布的《惠百惠服务协议》及相关附属规则，否则因此导致责任，均由您自行承担。<br />\r\n（九）您应遵守本服务的相关使用规则及要求，具体以惠百惠不时在页面提示的使用规则及限制为准。<br />\r\n第四条协议修改<br />\r\n（一）惠百惠将有权随时修改本协议的有关条款，一旦相关内容发生变动，惠百惠将会通过电子系统回复或JC APP公告等方式向您提示修改内容。<br />\r\n（二）如果您不同意惠百惠对本协议相关条款所做的修改或者惠百惠不时公布的《惠百惠服务协议》及相关附属规则，您应立即停止使用惠百惠提供的本项服务。如果您继续使用惠百惠提供的服务，则视为您接受并认可本协议相关条款的修改及惠百惠不时公布的《惠百惠服务协议》及相关附属规则。<br />\r\n<p>\r\n	第五条争议的解决\r\n</p>\r\n<p>\r\n	&nbsp;双方在履行本协议的过程中，如发生争议，应协商解决。协商不成的，任何一方均可向沈阳市皇姑区人民法院提起诉讼。<br />\r\n第六条协议的解释<br />\r\n&nbsp;本协议的成立、生效、履行和解释，均适用中华人民共和国法律；法律无明文规定的，应适用惠百惠公司制定的业务规则和通行的商业惯例。本服务协议未规定部分依照《惠百惠服务协议》及相关附属规则予以履行；本协议与《惠百惠服务协议》及相关附属规则相冲突的，以本协议为准。\r\n</p>\r\n<br />\r\n<br />\r\n<br />', '1', '13', '1', '1511771397', '1515722944');
INSERT INTO `dh_announcement` VALUES ('84', '1分享赚佣金', '每月25日将结算上一个自然月确认收货的订单，未确认收货的订单将在下月25日结算，结算后的消费佣金将自动计入您的余额中，您可以通过绑定支付宝，微信随时申请提现，申请后收益将在48小时内到账', '', '<p>\r\n	1好友通过您的邀请码注册成为耍哈会员后，Ta即永久成为您的耍哈会员，未来Ta升级市场运营或领券下单时产生的消费佣金均计入您的账户中。<br />\r\n<br />\r\n关于消费佣金:<br />\r\n<br />\r\n(1) 每月25日将结算上一个自然月确认收货的订单，未确认收货的订单将在下月25日结算，结算后的消费佣金将自动计入您的余额中，您可以通过绑定支付宝，微信随时申请提现，申请后收益将在48小时内到账；<br />\r\n<br />\r\n(2) 当出现取消订单、退货退款、或者因订单异常等情况时，消费佣金将相应扣除，实际根据系统结算为准。<br />\r\n<br />\r\n名词解析<br />\r\n<br />\r\n&nbsp;<br />\r\n<br />\r\n1. 累计收益：累计结算的消费佣金；<br />\r\n<br />\r\n2. 结算收入（上月佣金）：上个月内确认收货的订单收益，每月25日结算后，将累计到余额中；<br />\r\n<br />\r\n3. 预估收入（本月佣金）：本月内创建的所有订单预估收益；<br />\r\n<br />\r\n4. 预估收入（上月佣金）：上月内创建的所有订单预估收益；<br />\r\n<br />\r\n5. 今日预估收入：今日所有订单预估收益；<br />\r\n<br />\r\n6. 昨日预估收入：昨日所有订单预估收益；<br />\r\n<br />\r\n7. 付款笔数：今天内所有付款的订单数量，包含有效订单和失效订单；<br />\r\n<br />\r\n8. 失效订单：取消付款、退货退款、申请维权或因订单异常，均为失效订单；<br />\r\n<br />\r\n9. 自然月：自然月是指每个月的1号到该月的最后一天。\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<br />\r\n</p>', '1', '1', '1', '1527558348', '1533714899');
