DROP TABLE IF EXISTS `dh_goods`;
CREATE TABLE `dh_goods` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `cid` int(11) unsigned NOT NULL COMMENT '所属分类',
  `from_cid` int(11) unsigned NOT NULL COMMENT '来源分类ID',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '商品类型 0未知类型 11淘宝 12 天猫 21京东 31拼多多',
  `origin_id` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '原始ID',
  `from_id` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '商品来源ID',
  `origin_price` decimal(11,2) unsigned NOT NULL COMMENT '原价',
  `coupon_price` decimal(11,2) unsigned DEFAULT '0.00' COMMENT '优惠券后价格',
  `title` varchar(255) NOT NULL COMMENT '标题',
  `sub_title` varchar(255) DEFAULT NULL COMMENT '副标题',
  `thumb` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '缩略图',
  `coupon_id` varchar(100) CHARACTER SET utf8 DEFAULT NULL COMMENT '优惠券ID',
  `coupon_money` decimal(11,2) unsigned DEFAULT '0.00' COMMENT '优惠券金额',
  `coupon_rate` decimal(11,1) unsigned DEFAULT '0.0' COMMENT '优惠券折扣',
  `coupon_total` int(11) unsigned DEFAULT '0' COMMENT '优惠券总量',
  `coupon_remained` int(11) unsigned DEFAULT '0' COMMENT '优惠券剩余',
  `coupon_received` int(11) unsigned DEFAULT '0' COMMENT '已领券数量',
  `coupon_start_at` int(11) unsigned DEFAULT NULL COMMENT '券开始时间',
  `coupon_end_at` int(11) unsigned DEFAULT NULL COMMENT '券结束时间',
  `coupon_link` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '优惠券链接',
  `coupon_short_link` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '优惠券短链',
  `coupon_condition` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '优惠券条件',
  `commission_money` decimal(11,2) unsigned DEFAULT '0.00' COMMENT '佣金',
  `commission_rate` decimal(11,2) unsigned DEFAULT '0.00' COMMENT '佣金比率',
  `commission_rate_plan` decimal(11,2) unsigned DEFAULT '0.00' COMMENT '计划佣金比率',
  `commission_rate_queqiao` decimal(11,2) unsigned DEFAULT '0.00' COMMENT '鹊桥佣金比率',
  `plan_type` tinyint(1) unsigned DEFAULT '0' COMMENT '计划类型',
  `plan_status` tinyint(1) unsigned DEFAULT '0' COMMENT '计划状态',
  `plan_link` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '计划链接',
  `sales_num` int(11) unsigned DEFAULT '0' COMMENT '商品销量',
  `keywords` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '关键词',
  `description` varchar(255) DEFAULT NULL COMMENT '描述',
  `info` text CHARACTER SET utf8 COMMENT '商品详情',
  `seller_id` varchar(255) DEFAULT NULL COMMENT '卖家id',
  `seller_nickname` varchar(255) DEFAULT NULL COMMENT '卖家昵称',
  `choice` tinyint(1) unsigned DEFAULT '0' COMMENT '精选',
  `settop` tinyint(1) unsigned DEFAULT '0' COMMENT '置顶',
  `praise` int(11) unsigned DEFAULT '0' COMMENT '赞',
  `view` int(11) unsigned DEFAULT '0' COMMENT '浏览量',
  `ems_type` tinyint(1) DEFAULT '0' COMMENT '包邮，0表不包邮，1表示包邮',
  `start_time` int(11) unsigned DEFAULT NULL COMMENT '开始时间',
  `end_time` int(11) unsigned DEFAULT NULL COMMENT '结束时间',
  `reply` text CHARACTER SET utf8 COMMENT '回复',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '状态 0隐藏 1显示',
  `created_at` int(11) unsigned DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) unsigned DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `type_2` (`type`,`origin_id`),
  KEY `origin_id` (`origin_id`),
  KEY `cid` (`cid`),
  KEY `end_time` (`end_time`),
  KEY `coupon_remained` (`coupon_remained`),
  KEY `type` (`type`),
  KEY `created_at` (`created_at`),
  KEY `rds_idx_0` (`type`,`status`,`coupon_price`)
) ENGINE=InnoDB AUTO_INCREMENT=23013 DEFAULT CHARSET=utf8mb4;

