  `pay_password` varchar(255) DEFAULT NULL COMMENT '交易密码',
  `error_password` tinyint(1) unsigned DEFAULT '0' COMMENT '密码错误次数',
  `avatar` varchar(255) DEFAULT '' COMMENT '头像',
  `gender` tinyint(1) unsigned DEFAULT '0' COMMENT '性别0女1男',
  `status` tinyint(4) DEFAULT '0',
  `access_token` varchar(255) DEFAULT NULL COMMENT 'api接口密匙',
  `created_at` int(11) unsigned DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) unsigned DEFAULT NULL COMMENT '更新时间',
  `lock_version` int(11) unsigned DEFAULT '0' COMMENT '锁版本',
  `alimm_pid` varchar(100) DEFAULT NULL COMMENT '淘宝联盟广告位',
  `jd_pid` varchar(100) DEFAULT NULL COMMENT '京东广告位',
  `pdd_pid` varchar(100) DEFAULT NULL COMMENT '拼多多广告位',
  `invite_code` varchar(10) DEFAULT NULL COMMENT '邀请码',
  `withdraw_to` varchar(50) DEFAULT NULL COMMENT '提现账户',
  `frozen` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '提现冻结金额',
  `identity_card` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `tb_account` varchar(50) DEFAULT '' COMMENT '淘宝帐号',
  `lv_past_time` int(10) DEFAULT '0' COMMENT '会员过期时间',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `mobile` (`mobile`) USING BTREE,
  UNIQUE KEY `dh_user_wechat_openid_uindex` (`wechat_openid`) USING BTREE,
  UNIQUE KEY `invite_code` (`invite_code`) USING BTREE,
  UNIQUE KEY `jd_pid` (`jd_pid`) USING BTREE,
  UNIQUE KEY `pdd_pid` (`pdd_pid`) USING BTREE,
  UNIQUE KEY `alimm_pid` (`alimm_pid`) USING BTREE,
  KEY `invite_code_2` (`invite_code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

